createSelect(label, "Repeat?", "repeated", ["None", "Daily", "Weekly", "Fortnightly", "Monthly", "Yearly"]);
createInput(label, "Notes:", "notes", "text", "FILL");
createTextArea(label, "Checklist (each list item on a new line)", "checklist", "5", "33")

form.append(ul);

